import React from 'react';
import './User.css'
import Register from './Register';
import LogIn from './LogIn';
import userUtils from '../../utils/user_utils/userUtils';

function User(){
    let login = window.location.search === '?login';
    React.useEffect(()=>{
        document.querySelectorAll('.userBtn').forEach(btn=> btn.addEventListener('click', userUtils.handleUserHeader));
    }, []);

    return(
        <div className='content_block'>
            <div className='user_header'>
                <div id='register_label'><label id='regBtn' className='userBtn'>Register</label></div>
                <div id='Login_label'><label id='loginBtn'>Login</label></div>
            </div>
            <div className='user_content'>
                {login? <LogIn />: <Register />}
            </div>
        </div>
    );
}

export default User;
